#ECrypt Lanucher By Chad Baxter http://computeco.de/
$b64 = ""
$content = [System.Convert]::FromBase64String($b64)
Push-Location -Path $env:TEMP
Set-Content ecrypt.jar -Value $content -Encoding Byte -Force
Start-Process java -ArgumentList '-jar ecrypt.jar' -WindowStyle Hidden
Pop-Location
$wshell = New-Object -ComObject Wscript.Shell
$wshell.Popup("ECrypt is being launched. If it does not launch, please try reinstalling Java.",0,"Launching...",0x0)
